fragment MenuItemFragment on MenuItem {
  category {
    id
    name
    __typename
  }
  collection {
    id
    name
    __typename
  }
  id
  level
  name
  page {
    id
    title
    __typename
  }
  url
  __typename
}

fragment MenuItemNestedFragment on MenuItem {
  ...MenuItemFragment
  children {
    ...MenuItemFragment
    children {
      ...MenuItemFragment
      children {
        ...MenuItemFragment
        children {
          ...MenuItemFragment
          children {
            ...MenuItemFragment
            children {
              ...MenuItemFragment
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}

fragment MenuDetailsFragment on Menu {
  id
  items {
    ...MenuItemNestedFragment
    __typename
  }
  name
  __typename
}

query MenuDetails($id: ID!) {
  menu(id: $id) {
    ...MenuDetailsFragment
    __typename
  }
}
